namespace Home\Model\System;

use Home\Model\Common\LogUtils;
use Home\Model\Common\SessionManager;
use Home\Model\Entry\MasterManager;

class System610092
{
    /**
     * @brief: 特殊数据内容段
     * @return string
     */
    public static function getSpecialCodeFragment()
    {
        LogUtils::info("System610092::getSpecialCodeFragment ---> start");
        $isReportUser =  MasterManager::isReportUserInfo();
        LogUtils::info("System610092::getSpecialCodeFragment ---> isReportUser" . $isReportUser);

        if (substr(MasterManager::getAccountId(),0,2) == '29') {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
            return $data;
        }

        //设置25秒等待时长
        $tm = MasterManager::getEnterAppTime();
        if(time() - $tm < 25){
            return "wait";
        }

        if ($isReportUser == 1) {
            $data = "";
        } else {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
        }
        LogUtils::info("System610092::getSpecialCodeFragment ---> data" . $data);
        return $data;
    }
}